We are very fortunate to have worked with so many legendary Artists & Labels over the years. Still, we were excited like it's our first time when we heard that our latest cut ‘Doppler’ caught the ear of Adam Beyer. After meeting with the Truesoul founder in early 2022, the ground was laid for our label debut. We are deeply thankful that our collaborations EP with Victor Pilava & Roemisch gonna get this legendary platform! Tomorrow we will be finally able to share the results with all of you!! 
So stay tuned! ⚡️

Swipe 4 is when we played 'Mephisto' for the first time infront of a crowd. Check out their reaction and make sure you play it loud!! 🔊💥

